import icongray from "../../../images/button-gray.png";

function Mark() {
	return (
		<div
			style={{
				color: "rgb(25,25,25)",
				fontFamily: "Roboto,Arial,sans-serif",
				fontSize: "24px",
				lineHeight: "36px",
				paddingLeft: "9px",
				paddingRight: "9px",
			}}
		>
			<img src={icongray} alt="" />
		</div>
	);
}

function CenterButton(props) {
	return (
		<div
			ref={props.centerElement}
			style={{
				backgroundColor: "#fff",
				border: "2px solid #fff",
				borderRadius: "3px",
				boxShadow: "0 2px 6px rgba(0,0,0,.3)",
				cursor: "pointer",
				marginBottom: "22px",
				textAlign: "center",
				marginRight: "10px",
				top: "null",
				display: props.loaded ? "block" : "none",
			}}
			onClick={() => {
				props.map.current.setCenter(props.locationState);
			}}
		>
			<Mark />
		</div>
	);
}

export default CenterButton;
